import React from "react";
import { ReactElement } from "react";

let NewWorkout = (): ReactElement => {
  return (
    <>
      <p style={{ marginTop: "2.5em" }}>Workout Details</p>
      <p style={{ marginTop: "2.5em" }}>4 sets</p>
      <p style={{ marginTop: "2.5em" }}>40 seconds per set</p>

    </>
  );
}

export default NewWorkout;
